const Collections = (props) => {
  const allGames = props.allGames.map((e, index) => {
    return (
        <tr key={index}>
            <td id={index}>
                {e.name}
            </td>
            <td>{e.buydate}</td>
            <td>${e.buyprice.toFixed(2)}</td>
            <td>{e.selldate}</td>
            <td>{e.selldate !== "" && e.sellprice.toFixed(2)}</td>
            <td>{e.playcount}</td>
            <td>{e.playcount > 0 ? Math.round((e.buyprice - e.sellprice)*100/e.playcount)*100 : "-"}</td>
        </tr>
    )
  })

    return (
    <div className="collections">
      <div>
        <h2>Your Collection</h2>
      </div>
      <table>
        <tr>
            <th>Name</th>
            <th>Purchase Date</th>
            <th>Currency</th>
            <th>Damage</th>
            <th>Sell Date</th>
            <th>Currency</th>
            <th>Heal</th>
            <th># plays</th>
            <th>Cost / Play</th>
        </tr>
        {allGames}
      </table>
    </div>
  );
};

export default Collections;
